                },
            });
            let select2 = new CustomSelect('#select-2', {
                onSelected(select, option) {

                    // выбранный текст опции
                    const text = option ? option.textContent : '';
                    option = ' гостей';
                },
                _changeValue(option) {
                    console.log(option)
                },
            });

            function checkFilled(targetClass) {
                let inputVal = document.querySelector('.name-input');
                if (inputVal.value == "") {
                    inputVal.classList.add('active');
                } else {
                    inputVal.classList.remove('active');
                }
            }
        })
